import { Component, OnInit } from '@angular/core';
import { AuthService } from 'src/app/shared/auth.service';


@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent implements OnInit{

  email : string = '';
  password : string = '';
  

  constructor(private auth : AuthService) {}

  ngOnInit(): void {

  }

  register() {
    if(this.email == '') {
      alert('Por favor insira seu email');
      return;
    }
  
    if(this.password == '') {
      alert('Por favor insira sua senha');
      return;
    }
  
    this.auth.register(this.email, this.password);
  
    this.email = '';
    this.password = '';
   }
}
<!DOCTYPE html>
<html lang="pt-br">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Cadastre-se</title>
</head>
<body>
    <h1>Cadastre-se</h1>
<form> 
<div class="form-group">
   
    <input type="email" id="email" name="email" [(ngModel)]="email" placeholder="Seu email" required>
</div>
<div class="form-group">
    
    <input type="password" id="password" name="password" [(ngModel)]="password" placeholder="Sua senha" required>
</div>
<button type="submit" (click)="register()">Cadastrar</button>
<a type="submit" href="login()">Login</a>
</form>

</body>
</html>
